export const  Body = (props)=>{
    let bodyStyle = {
        textAlign: 'center',
    margin: '5vh 5% 0px',
    }
    let bodyDiv = {
        margin: '3% 20vw',
    }
    return (
        <div style={bodyStyle}>
            this is body
        </div>
    )
}
